import React from "react";
import styled from "styled-components";
//import PropTypes from "prop-types";

const BlocStyled = styled.div`
  position: absolute;
  top: 5px;
  left: -200px;
  background-color: white;
  width: 200px;
  height: 50px;
  border-corner: 5px;
`;

const DashBoard = ({}) => {
  return <BlocStyled>{"Niv"}</BlocStyled>;
};

DashBoard.propTypes = {};

export default DashBoard;
